//components
import w1 from "../../Assets/w1.jpeg"
 import { HashLink as Link } from "react-router-hash-link";

//styled
import { AboutSessionsContainer,AboutSessionDescription,AboutSessionDescriptionspan,WhyImageWraper,} from "./AboutStyle";
import {
    WhySessionsContainerHalf,
    WhySessionsContainerHalfDivider,
    WhyDividerContent,

  } from "../WhySection/WhyStyle";
  import {
    SessionDescription,
    SessionHeader,
    SessionName,
    SessionsTitle,
  } from "../Testimonial/TestimonialStyle";

const AboutSection = () => {
  return (
    <AboutSessionsContainer>
      <WhySessionsContainerHalf>
        <SessionsTitle>ABOUT US</SessionsTitle>
        <SessionHeader>Who are we?</SessionHeader>
        <AboutSessionDescription>
       <AboutSessionDescriptionspan>FKL Cleaning Service and Sells LLC </AboutSessionDescriptionspan> provide commercial/residential cleaning services in Westbrook, Maine, and surrounding areas. We pride ourselves on providing professional customer care. making our customers happy is our Happiness.  Since opening our doors, we've been committed to providing service of the highest quality, paying particular attention to working efficiently while keeping the lines of communication with our clients clear and concise. Our mission is simple: to provide high-quality services in a timely manner. Our team caters to each project's specific needs to ensure excellence.  we're finally pleased once we notice the happiness and smile on the client's face. We hope you'll find what you're looking for. For more information or general inquiries, feel free to get in touch today. 
        </AboutSessionDescription>
        <Link to="#contact" className="quotelinks quotecollinks quote">
          Get a quote
        </Link>
      </WhySessionsContainerHalf>
      <WhySessionsContainerHalf>
      <WhySessionsContainerHalfDivider>

            <WhyImageWraper>
             <img src={w1} alt ="cleaning"/>
            </WhyImageWraper>


            <WhyImageWraper>

            </WhyImageWraper>

        </WhySessionsContainerHalfDivider>
      </WhySessionsContainerHalf>
    </AboutSessionsContainer>
  );
};

export default AboutSection;
